import React from "react";
import ReactDom from "react-dom";
import App from "./App";
import {BrowserRouter} from "react-router-dom";

ReactDom.render(
   <BrowserRouter>
   <Router>
    <ScrollToTop>
      <App/>
    </ScrollToTop>
  </Router>
   <App/>
   </BrowserRouter>,document.getElementById("root")
)
